function changeVisibility() {
    let target = document.getElementById('show-image');

}

function Input() {
    return (
        <section className="input-section">
            Test Your Password
            <div className="input-box">
                <input type="text"
                    className="input"   placeholder="Enter your password">
                </input>
                <img className="show-image" src="show.png" alt="Show Icon" onClick={changeVisibility}></img>
            </div>
        </section>
    );
}

export default Input;
